(4, 'Berita Pertama', 'Ini adalah berita pertama', '', '2014-07-04', 1, ',1,'),
(5, 'Berita Kedua', 'Selain masih aktif sebagai pengembang PHP, Rasmus Lerdorf juga pernah bekerja di Yahoo sebagai Arsitek Infrastruktur selama 7 tahun dari tahun 2002 hingga 2009. Pada tahun 2010, ia bergabung WePay untuk mengembangkan antarmuka pemrograman aplikasi mereka. Sepanjang tahun 2011 dia adalah seorang konsultan keliling untuk startups. Pada 22 Februari 2012 ia mengumumkan di Twitter bahwa ia telah bergabung dengan Etsy. Pada bulan Juli, 2013 Rasmus bergabung Jelastic sebagai penasihat senior untuk membantu mereka dengan penciptaan teknologi baru.', 'bffd016c7ca37f9d19c55b9b69652a15.jpg', '2014-07-23', 1, ',1,');
